option.value:
The `@Builder.Default` annotation in Lombok is used in conjunction with the `@Builder` annotation to specify default values for fields when using the Builder pattern.

### Why Use `@Builder.Default`

When you create a builder for a class using Lombok's `@Builder`, it usually skips direct field initialization present in the class and only sets the fields provided through the builder methods. This can be a problem if you have default values defined for some fields in your class.

### How to Use `@Builder.Default`

By annotating a field with `@Builder.Default`, you instruct Lombok to use the default value of that field if it is not explicitly set via the builder.

### Example

Let's look at a simple example:

```java
import lombok.Builder;
import lombok.Getter;
import lombok.ToString;

@Builder
@Getter
@ToString
public class Person {
    @Builder.Default
    private String name = "Unknown";
    @Builder.Default
    private int age = 0;
    private String address;
}

public class Main {
    public static void main(String[] args) {
        Person person = Person.builder()
                .address("123 Main St")
                .build();

        System.out.println(person); // Person(name=Unknown, age=0, address=123 Main St)
    }
}
```

### Explanation

- **name and age**: These fields have default values specified (`"Unknown"` and `0` respectively) using `@Builder.Default`.
- **address**: This field does not have a default value and needs to be provided.

When we create a `Person` object using the builder and do not set the `name` and `age` fields, they will default to their specified values ("Unknown" and `0`).

### Important Notes

1. **Compatibility**: Ensure that your Lombok version supports `@Builder.Default`, as it is not available in older versions.
2. **Final Fields**: `@Builder.Default` cannot be applied to `final` fields.
3. **Initialization**: The default value must be a compile-time constant or an expression that can be evaluated at runtime when creating the builder.

By using `@Builder.Default`, you ensure that the fields have consistent default values even when using the builder pattern, enhancing the robustness and readability of your code.

