The `@EqualsAndHashCode` annotation from Lombok generates `equals` and `hashCode` methods for the annotated class. By default, it uses all non-static fields of the class. However, you can customize this behavior using several parameters:

- `of`: Specifies the fields that should be used to generate the `equals` and `hashCode` methods. This is a varargs parameter where you can pass field names.
- `exclude`: Specifies the fields that should be excluded from the generated `equals` and `hashCode` methods. This is a varargs parameter where you can pass field names.
- `callSuper`: A boolean flag that dictates whether the `equals` and `hashCode` methods should include the superclass's `equals` and `hashCode` methods. The default value is false.
- `onlyExplicitlyIncluded`: When set to true, only the fields explicitly annotated with `@EqualsAndHashCode.Include` will be included, and fields explicitly annotated with `@EqualsAndHashCode.Exclude` will be excluded.

Here is an example for better understanding:

```java
import lombok.EqualsAndHashCode;

@EqualsAndHashCode(of = {"id"}, exclude = {"name"}, callSuper = true, onlyExplicitlyIncluded = false)
public class MyClass {
    private int id;
    private String name;

    // Getters and setters
}
```

In this example, `equals` and `hashCode` methods will be generated using the `id` field, will exclude the `name` field, will include the superclass's `equals` and `hashCode` methods, and will not consider the `@EqualsAndHashCode.Include` and `@EqualsAndHashCode.Exclude` annotations on the fields.

You can also selectively include or exclude fields using the `@EqualsAndHashCode.Include` and `@EqualsAndHashCode.Exclude` annotations on specific fields:

```java
import lombok.EqualsAndHashCode;

@EqualsAndHashCode(onlyExplicitlyIncluded = true)
public class MyClass {
    @EqualsAndHashCode.Include
    private int id;

    @EqualsAndHashCode.Exclude
    private String name;

    // Getters and setters
}
```

In this case, `equals` and `hashCode` will include only the `id` field and will exclude the `name` field.

